// 通常問題の実行
// 解答ファイルと .in .outファイルを使用する
// visはスコア計算とヴィスアライズを行う
func runNormal(seed int) (data map[string]interface{}) {
	data = map[string]interface{}{}
	return
}

func run(seed int) {
	exe := "./tools/target/release/tester" + " " + "./bin/a"
	inFile := fmt.Sprintf("./tools/in/%04d.txt", seed)
	outFile := fmt.Sprintf("./out/%04d.txt", seed)
	cmdStr := exe + " < " + inFile + " > " + outFile

	cmd := exec.Command("sh", "-c", cmdStr)

	// Get combined standard output and standard error.
	output, err := cmd.CombinedOutput()
	if err != nil {
		log.Fatal(err)
	}
	cmd.Wait()

	outputStr := strings.TrimSpace(string(output)) // Convert []byte to string and trim whitespace

	fmt.Println("Finished processing seed =", seed)
	fmt.Println("Output and error from cmd: ", outputStr)
}

// インタラクティブ問題の実行
// この時配布される実行ファイルは、tools/target/release/tester
func runInteractive(seed int) map[string]interface{} {
	data := map[string]interface{}{}
	exe := P + "/tools/target/release/tester" + " " + P + "/bin/a"
	inFile := fmt.Sprintf("%s/tools/in/%04d.txt", P, seed)
	outFile := fmt.Sprintf("%s/out/%04d.txt", P, seed)
	cmdStr := exe + " < " + inFile + " > " + outFile
	cmds := []string{"sh", "-c", cmdStr}
	cmd := exec.Command(cmds[0], cmds[1:]...)
	var stderr bytes.Buffer
	cmd.Stderr = &stderr
	var stdout bytes.Buffer
	cmd.Stdout = &stdout
	//log.Println(cmd.String())
	err := cmd.Start()
	if err != nil {
		log.Println(cmds)
		log.Fatal(err)
	}
	cmd.Wait()
	for _, rg := range rss {
		v, err := parseInt(stderr.String(), rg.re, rg.str+"=")
		if err != nil {
			log.Println("seed=", seed)
			log.Println(stderr.String())
			log.Fatal(err)
		}
		data[rg.str] = v
	}
	data["seed"] = seed
	fmt.Println("seed=", seed, data)
	//fmt.Println(stderr.String())
	//fmt.Printf("seed:%3d cost=%d time=%4d\n",seed, data["cost"].(int), data["time"].(int))
	return data
}

func parallelRun() {
	CORE := 4
	seedSize := 200
	sumScore := 0
	datas = make([]map[string]interface{}, 0)
	var mu sync.Mutex
	var wg sync.WaitGroup
	sem := make(chan struct{}, CORE)
	for i := 0; i < seedSize; i++ {
		wg.Add(1)
		sem <- struct{}{}
		go func(seed int) {
			d := runInteractive(seed)
			mu.Lock()
			datas = append(datas, d)
			sumScore += d["totalCost"].(int)
			mu.Unlock()
			wg.Done()
			<-sem
		}(seed1[i]) // seedの指定
	}
	wg.Wait()
	log.Println("END")
	fmt.Println("sum=", sumScore, math.Log(float64(sumScore)))
}

type regexpStr struct {
	re  *regexp.Regexp
	str string
}

var rss []regexpStr = []regexpStr{
	{regexp.MustCompile(`Score = ([0-9]+)`), "score"},
	//	{regexp.MustCompile(`totalCost=([0-9]+)`), "totalCost"},
	//
	// {regexp.MustCompile(`time=([0-9]+)`), "time"},
	// {regexp.MustCompile(`N=([0-9]+)`), "N"},
	// {regexp.MustCompile(`W=([0-9]+)`), "W"},
	// {regexp.MustCompile(`K=([0-9]+)`), "K"},
	// {regexp.MustCompile(`C=([0-9]+)`), "C"},
}

func parseInt(src string, re *regexp.Regexp, str string) (int, error) {
	match := re.FindString(src)
	num, err := strconv.Atoi(strings.Replace(match, str, "", -1))
	if err != nil {
		log.Println(err, str, match)
		return -1, err
	}
	return num, nil
}

func vis(input string, output string) (score int) {
	vispath := P + "/tools/target/release/vis"
	cmdStr := vispath + " " + input + " " + output
	cmds := []string{"sh", "-c", cmdStr}
	var out []byte
	var err error
	out, err = exec.Command(cmds[0], cmds[1:]...).Output()
	if err != nil {
		log.Fatal(err)
	}
	outs := strings.Split(string(out), "\n")
	score, err = strconv.Atoi(outs[0])
	if err != nil {
		panic(err)
	}
	return score
}

